import React from 'react';
import {useState} from 'react';
import ReactDOM from 'react-dom/client';
import { Link } from "react-router";



export default function Page4() {

    const [inputs, setInputs] = useState({});
    const handleChange = (event) => {
        const name = event.target.name;
        const value = event.target.value;
        setInputs(values => ({...values, [name]: value}))
      }
      const handleSubmit = (event) => {
        event.preventDefault();  
      }

    return (
        <body>
            <header><h1>MedLab Registration Form</h1></header>
            <form onSubmit={handleSubmit}>
            <h2>Review</h2>
            <label>First name:</label>
            <label id="first_name"></label><br/> 
            
            <label>Last name:</label>
            <label id="last_name"></label><br/> 

            <label>Email:</label>
            <label id="email"></label><br/>

            <label>Phone number:</label>
            <label id="phone_number"></label><br/>

            <label>Address:</label>
            <label id="page4_address"></label><br/>

            <label>Address 2:</label>
            <label id="address2.2"></label><br/>

            <label>City:</label>
            <label id="city"></label><br/>

            <label>State:</label>
            <label id="state"></label><br/>

            <label>Zip:</label>
            <label id="zip"></label><br/>
            
            <h3>Is this information correct?</h3>
            <br/>
            <Link to="/page3">
                <input type="button" value="No, Go Back" />
            </Link>
            <Link to="/page4">
                <input type="submit" value="Yes & Submit" />
            </Link>
            </form>
            <footer>
                    <div id="address">MedLab Medical Clinics of America <br/>
                         1074 Jadewood Drive, Suite 330 <br/>
                         Chicago, Illinois 60647 <br/>
                    </div>
                     <div id="contact">
                         Phone: 630-921-0000 <br/>
                         Fax: 773-709-3312
                    </div>
             </footer>
        </body>
    )
}
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
 <Page4/>
);
